import { Product } from 'src/app/Models/Product';
import { ProductService } from 'src/app/Services/product.service';

@Component({
  selector: 'app-myproducts',
  templateUrl: './myproducts.component.html',
  styleUrls: ['./myproducts.component.css']
})
export class MyproductsComponent {
  products: Product;
  userid: number;

  constructor(private activeRoute:ActivatedRoute,private service:ProductService, private router:Router){}

  ngOnInit(userid:number){
    this.userid = parseInt(sessionStorage.getItem('userid') || '0',10);
    this.userid = this.activeRoute.snapshot.params['id'];
    console.log("UserId from myproducts =====> " + userid);

   this.service.getProductsByUserId(userid).subscribe(data => {
      this.products = data;
      console.log(this.products);
    })
  }
}
